(67,'',35,1679322195,1679322195,0,0,0,0,'',256,0,0,0,0,NULL,'',0,0,0,0,'textmedia','','','<p>Cette discipline consiste √† cr√©er une coh√©sion entre le ma√Ætre et son chien.</p>\r\n<p>Cela reste de l\'agility mais l\'on proc√®de de fa√ßon ralenti, on cherche √† stabiliser le chien pour diminuer les d√©parts incontr√¥l√©s sur les joggeurs, cyclistes,.....</p>\r\n<p>Cette discipline se pratique avec un chien en libert√©, il doit attendre le code pour passer l\'obstacle.</p>\r\n<p>En appliquant cette m√©thode, vous obtiendrez un chien √† l\'√©coute, un chien stable.</p>',0,0,0,0,0,0,0,2,0,0,0,'default',0,'','',NULL,NULL,0,'','',0,0,'',1,0,NULL,0,'','','',0,0,0,NULL,'','',NULL,124,0,0,0,0,NULL,0,0,0,'',0,0,0,0),
