(138,'',58,1722409144,1722409144,0,0,0,0,'',512,0,0,0,0,NULL,'',0,0,0,0,'text','','','<p>Sonarr est une application open-source destin√©e √† la gestion automatique des t√©l√©chargements de s√©ries t√©l√©vis√©es. Con√ßue pour fonctionner avec des clients de t√©l√©chargement comme SABnzbd, NZBGet, et divers clients BitTorrent, Sonarr aide les utilisateurs √† trouver, t√©l√©charger, organiser et g√©rer leurs s√©ries TV pr√©f√©r√©es. Voici un aper√ßu d√©taill√© de ses fonctionnalit√©s et avantages :</p>\r\n<h2>Fonctionnalit√©s principales de Sonarr</h2>\r\n<ol><li>Recherche et t√©l√©chargement automatique :<br>Sonarr peut rechercher automatiquement les nouveaux √©pisodes de s√©ries t√©l√©vis√©es en fonction des pr√©f√©rences d√©finies par l\'utilisateur, et les t√©l√©charger via des clients de t√©l√©chargement comme SABnzbd, NZBGet, Transmission, qBittorrent, et Deluge.</li><li>Support des indexeurs Usenet et Torrent :<br>Utilise des indexeurs pour rechercher des fichiers sur Usenet et BitTorrent. Sonarr peut s\'int√©grer avec des services comme Jackett pour acc√©der √† une large gamme d\'indexeurs.</li><li>Organisation des fichiers :<br>G√®re l\'organisation des √©pisodes t√©l√©charg√©s en les renommant automatiquement selon des sch√©mas d√©finis par l\'utilisateur et en les pla√ßant dans des dossiers sp√©cifiques.</li><li>Suivi et gestion des s√©ries :<br>Permet de suivre les s√©ries t√©l√©vis√©es, y compris les saisons et les √©pisodes, en fournissant des informations d√©taill√©es et des m√©tadonn√©es enrichies (r√©sum√©s, affiches, acteurs, etc.) via des bases de donn√©es comme TheTVDB et TVmaze.</li><li>Calendrier des sorties :<br>Affiche un calendrier des prochaines sorties d\'√©pisodes, permettant aux utilisateurs de voir facilement quand les nouveaux √©pisodes seront disponibles.</li><li>Gestion des versions et des qualit√©s :<br>Permet de d√©finir des pr√©f√©rences de qualit√© pour chaque s√©rie, garantissant que les t√©l√©chargements respectent les crit√®res d